import React from 'react';
import styled from 'styled-components';
import titleImgMini from '../data/img/main_title_mini.png';

const MainPage = () => {
    return (
        <div>
            <img src={titleImgMini} alt={titleImgMini}/>
        </div>
    )
}

export default MainPage;
